    <script id="engine-start" type="text/javascript" merge="keep">
      Module.persistentStorage = !1;
      EngineLoader.load("canvas", "DefoldGames");
        //let a = "string" == typeof e.data ? JSON.parse(e.data) : e.data;
        let timer;
        let seconds = 0;
        let minutes = 0;

        function startTimer() {
            if (!timer) {
                timer = setInterval(updateTimer, 1000);
            }
        }

        function resetTimer() {
            clearInterval(timer);
            timer = null;
            seconds = 0;
            minutes = 0;
            document.getElementById('timer').textContent = '00:00';
        }

        var frozen = false;
        var cipherE = null;

        function handleTouchStart(event) {
          if (frozen) {
            frozen = false;
            parent.postMessage(
            JSON.stringify({
            method: "OnGameFinished",
            cipher: cipherE
          })
        );
        //onSandboxMessage(null);
          }
          // Add any additional logic you want to execute on touch start
        }

        // Attach the event listener to the document
        document.addEventListener('touchstart', handleTouchStart, false);

        function updateTimer() {
          if (!frozen) {
            seconds++;
            if (seconds === 60) {
                seconds = 0;
                minutes++;
            }
            document.getElementById('timer').textContent = `${minutes < 10 ? '0' + minutes : minutes}:${seconds < 10 ? '0' + seconds : seconds}`;
          }
        }

      function onSandboxMessage(e) {
        if (!frozen) {
          resetTimer();
          startTimer();
        }
        
        const a = {
          method: "StartGame",
          level:
            "- a - - c c.- a b b d -.0 0 e - d -.f f e g g h.s z z x - h.s - - x - h",
          number: 0
        };
        a && "StartGame" === a.method && JsToDef.send("__StartGame", a);
      }
      function OnGameFinished(e) {
        frozen = true;
        cipherE = e;
        //parent.postMessage(
          //JSON.stringify({
            //method: "OnGameFinished",
            //cipher: e
          //})
        //);
      }
      function OnSceneLoaded() {
        parent.postMessage(
          JSON.stringify({
            method: "OnSceneLoaded"
          })
        );
      }
      window.addEventListener("message", onSandboxMessage, !1);
    </script>
